import React from "react";
import { Button } from "antd";
import { updateStoreToolId } from "../redux/toolSlice";
import { useDispatch, useSelector } from "react-redux";
export default function Graph() {
  const dispatch = useDispatch();
  const { toolID } = useSelector((state) => state.tool);
  const onChange = (e) => {
    dispatch(updateStoreToolId("change"));
  };
  return (
    <div>
      <svg
        version="1.1"
        baseProfile="full"
        width="500"
        height="200"
        xmlns="http://www.w3.org/2000/svg"
      >
        <rect width="100%" height="100%" fill="white" />

        <circle cx="150" cy="100" r="50" fill="green" />
        <circle cx="250" cy="100" r="50" fill="green" />
        <circle cx="350" cy="100" r="50" fill="green" />
        <circle cx="450" cy="100" r="50" fill="green" />

        <text x="150" y="125" font-size="60" text-anchor="middle" fill="white">
          SVG
        </text>
      </svg>
    </div>
  );
}
